query RecentRuns($entity: String!, $project: String!, $limit: Int) {
  project(name: $project, entityName: $entity) {
    id
    name
    runCount
    runs(first: $limit, order: "-createdAt") {
      edges {
        node {
          id
          name
          displayName
          state
          createdAt
          summaryMetrics
        }
      }
      pageInfo {
        endCursor
        hasNextPage
      }
    }
  }
}

